import React from 'react'

function TransactionModule({transactions}) {
    const transactionList = transactions.map(transaction=>{
        return(
        <div className='transaction_rows' key={transaction.id}>
            <p className='time'>{transaction.created_at.toLocaleDateString()}</p>
            <p id='transaction_name'>{transaction.title}</p>
            <p id='Price'>{transaction.amount}</p>
        </div>)
    })
  return (

    <div className='transactions'>
      <h2 className='transaction_header'>Transactions</h2>
      <h3 className='transaction_dateview'>Date</h3>
      {transactionList}

    </div>

  )
}

export default TransactionModule
